import styled from 'styled-components';
import { motion } from 'framer-motion';
import jsPDF from 'jspdf';
import html2canvas from 'html2canvas';
import CoverSlide from './slides/CoverSlide';
import BigIdeaSlide from './slides/BigIdeaSlide';
import MarketStrategiesSlide from './slides/MarketStrategiesSlide';
import RevenuePotentialSlide from './slides/RevenuePotentialSlide';
import PartnershipsSlide from './slides/PartnershipsSlide';
import DeliverableSlide from './slides/DeliverableSlide';
import ViralStrategySlide from './slides/ViralStrategySlide';

const PitchDeck = () => {
  const downloadPDF = async () => {
    const pdf = new jsPDF({
      orientation: 'landscape',
      unit: 'mm',
      format: [297, 210],
      compress: true
    });
    
    const slides = document.querySelectorAll('.slide');
    const pdfWidth = pdf.internal.pageSize.getWidth();
    const pdfHeight = pdf.internal.pageSize.getHeight();
    
    for (let i = 0; i < slides.length; i++) {
      const slide = slides[i];
      
      const canvas = await html2canvas(slide, {
        scale: 3,
        useCORS: true,
        logging: false,
        allowTaint: true,
        backgroundColor: '#0A0A0F',
        width: 1920,
        height: 1080,
        windowWidth: 1920,
        windowHeight: 1080,
        x: 0,
        y: window.pageYOffset + slide.getBoundingClientRect().top,
        scrollX: 0,
        scrollY: -window.pageYOffset
      });

      const imgData = canvas.toDataURL('image/jpeg', 1.0);
      
      if (i > 0) {
        pdf.addPage();
      }

      pdf.addImage(imgData, 'JPEG', 0, 0, pdfWidth, pdfHeight);
    }
    
    pdf.save('Wizkid_Crypto_Pitch_Deck.pdf');
  };

  return (
    <>
      <ExportButton onClick={downloadPDF}>
        Export to PDF
      </ExportButton>
      <DeckContainer>
        <SlideWrapper className="slide">
          <SlideContent>
            <CoverSlide />
          </SlideContent>
        </SlideWrapper>
        <PageBreak />
        <SlideWrapper className="slide">
          <SlideContent>
            <BigIdeaSlide />
          </SlideContent>
        </SlideWrapper>
        <PageBreak />
        <SlideWrapper className="slide">
          <SlideContent>
            <MarketStrategiesSlide />
          </SlideContent>
        </SlideWrapper>
        <PageBreak />
        <SlideWrapper className="slide">
          <SlideContent>
            <RevenuePotentialSlide />
          </SlideContent>
        </SlideWrapper>
        <PageBreak />
        <SlideWrapper className="slide">
          <SlideContent>
            <PartnershipsSlide />
          </SlideContent>
        </SlideWrapper>
        <PageBreak />
        <SlideWrapper className="slide">
          <SlideContent>
            <DeliverableSlide />
          </SlideContent>
        </SlideWrapper>
        <PageBreak />
        <SlideWrapper className="slide">
          <SlideContent>
            <ViralStrategySlide />
          </SlideContent>
        </SlideWrapper>
      </DeckContainer>
    </>
  );
};

const DeckContainer = styled.div`
  width: 100%;
  max-width: 100%;
  margin: 0;
  padding: 0;
  background: ${props => props.theme.colors.background};
`;

const SlideWrapper = styled.div`
  height: 100vh;
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 0;
  padding: 0;
  overflow: hidden;
  position: relative;
  background: ${props => props.theme.colors.background};
  page-break-after: always;
  page-break-inside: avoid;
`;

const SlideContent = styled.div`
  width: 1920px;
  height: 1080px;
  display: flex;
  align-items: center;
  justify-content: center;
  transform-origin: center;
  transform: scale(0.7);
  background: ${props => props.theme.colors.background};
`;

const PageBreak = styled.div`
  height: 100vh;
  width: 100%;
  background: ${props => props.theme.colors.background};
`;

const ExportButton = styled.button`
  position: fixed;
  top: 20px;
  right: 20px;
  z-index: 1000;
  background: ${props => props.theme.colors.gradient.primary};
  color: ${props => props.theme.colors.secondary};
  border: none;
  padding: 12px 24px;
  border-radius: 12px;
  font-size: 1rem;
  font-weight: 600;
  cursor: pointer;
  transition: all 0.3s ease;
  box-shadow: ${props => props.theme.shadows.card};

  &:hover {
    transform: translateY(-2px);
    box-shadow: ${props => props.theme.shadows.card}, 0 0 15px rgba(255, 215, 0, 0.3);
  }
`;

export default PitchDeck;
